	add("scientifiction", "{\"term\":\"scientifiction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|scientific|fiction|lang\u003den}}. Coined in 1916 by w:Hugo Gernsback|Hugo Gernsback.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"science fiction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1916\u0027\u0027 January, w:Hugo Hugo Gernsback, \u0027Electrical Experimenter\u0027, page 474\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I am supposed to report Münchhaussen\u0027s doings; am supposed to be writing fiction, \u0027\u0027\u0027scientifiction\u0027\u0027\u0027, to be correct\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1926\u0027\u0027, w:Hugo Hugo Gernsback, \u0027s:Amazing Stories/Volume 01/Number Amazing Stories,\u0027 \u0026quot;A New Sort of Magazine\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is the usual fiction magazine, the love story and the sex-appeal type of magazine, the adventure type, and so on, but a magazine of \u0026quot;\u0027\u0027Scientifiction\u0027\u0027\u0026quot; is a pioneer in its field in America. By \u0026quot;\u0027\u0027scientifiction\u0027\u0027\u0026quot; I mean the Jules Verne, H. G. Wells, and Edgar Allan Poe type of story—a charming romance intermingled with scientific fact and prophetic vision\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, Chad Walsh, \u0027C. S. Lewis: Apostle to the Skeptics\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Lewis\u0027s novels are the \u0027\u0027scientifiction\u0027\u0027 of a philosopher\", \"priority\":7}]}, \"synonyms\":{}}");

